import React from "react";
import "./Main_Top.css";

function Main_Top() {
  return (
    <section className="main_top">
      <div
        className="main_top"
        style={{
          backgroundImage: "url('/about-banner.png')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          height: "640px",
          width: "100%",
          display: "flex",
        }}
      >
        <img className="title" src="/about-banner-title.png" />
      </div>
    </section>
  );
}

export default Main_Top;
